import React from 'react'
import stylehome from './stylehome.css'
function Home() {
  return (
    <div className='img'>
      <img src="https://images.unsplash.com/photo-1663335468790-cf7e8a1e0e73?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1121&q=80" alt="img"/>
    </div>
  )
}

export default Home
